import "./Mainselect.css";
import data from "./Data3";
import data2 from "../contents/Data2";
import { useState } from "react";
function Selitem(props) {
  const [two, changeTwo] = useState(0);
  console.log("p1");
  let a, b, c, d;
  let one = 1;
  const imgclick = () => {
    changeTwo(1);
  };
  data.properties.map((index) => {
    if (props.index === index.index) {
      one = index._id;
    }
  });
  return (
    <div className="class2">
      <div className="angle">
        <div className="angle1">
          <img
            className="angle2"
            src={data.properties[one - 2].picture}
            alt="Loading..."
            onClick={imgclick}
          />
        </div>
        <div className="angle1">
          <img
            className="angle2"
            src={data.properties[one - 1].picture}
            alt="Loading..."
          />
        </div>
        <div className="angle1">
          <img
            className="angle2"
            src={data.properties[one].picture}
            alt="Loading..."
          />
        </div>
      </div>
      <div className="mainitem">
        <div className="Mainimg">
          <img
            src={data2.properties[props.index].picture}
            className="Mainimg2"
          />
        </div>
      </div>
      <div className="descrp2">
        <p className="txt3">{data.properties[props.index].name}</p>
        <p className="txt2">{data.properties[props.index].cat} Category</p>
        <p className="txt2">{data.properties[props.index].price}/-</p>
        <button className="btn1">Add To Cart</button>
        <br />
        <button className="btn2">Buy</button>
      </div>
    </div>
  );
}
export default Selitem;
